import React from "react";
import Sidebar from "../../../components/SideBar";
import { useSelector } from "react-redux";
import "./styles.css"
import { useEffect, useState } from "react";
import axios from "axios";


const VolunteerProfile = () => {

    const user = useSelector(state => state.user)

    return (
        <>
            <div>
                {console.log(user)}
                <div className="volunteer_profile_div">
                    <img src={user.img} alt="volunteer" />
                    <h2>{user.full_name}</h2>
                    <h5>Rol</h5>
                    <p>{user.rolId ? user.rol.tipo : 'Por favor, pongase en contacto con su gestor para que se le asigne un rol'}</p>
                    <h5>Sede</h5>
                    <p>{user.sede.nombre ? user.sede.nombre : 'Debes elegir una sede'}</p>
                </div>
            </div>
        </>
    );
};

export default VolunteerProfile;
